  var numericColumns = [
    "VLRFRETE",
    "CODEMP",
    "NUNOTA",
    "CODTIPOPER",
    "CODPARC",
    "CODVEND",
    "CODTIPVENDA",
    "CODPROD",
    "CODGRUPOPROD",
    "QTDNEG",
    "VLRUNIT",
    "VLRTOT",
    "VLRNOTA",
    "CUS_ENTRADACOMICMS",
    "FUN_PERCDESCTT",
    "FUN_ITECUSTT",
    "FUN_VLRTOTITE_LIQ",
    "FUN_ITELUCROBRUTOTT",
    "FUN_ITEMGB"
  ];

  function parseCSV(text) {
    var rows = [];
    var row = [];
    var field = "";
    var inQuotes = false;

    for (var i = 0; i < text.length; i += 1) {
      var char = text[i];
      var next = text[i + 1];

      if (char === "\"") {
        if (inQuotes && next === "\"") {
          field += "\"";
          i += 1;
        } else {
          inQuotes = !inQuotes;
        }
        continue;
      }

      if (char === "," && !inQuotes) {
        row.push(field);
        field = "";
        continue;
      }

      if (char === "\n" && !inQuotes) {
        row.push(field);
        rows.push(row);
        row = [];
        field = "";
        continue;
      }

      field += char;
    }

    if (field.length || row.length) {
      row.push(field);
      rows.push(row);
    }

    return rows;
  }

  function parseNumberBR(value) {
    if (value === null || value === undefined) {
      return null;
    }
    var trimmed = String(value).trim();
    if (trimmed === "") {
      return null;
    }
    var normalized = trimmed.replace(/\s/g, "");
    if (normalized.indexOf(",") >= 0) {
      normalized = normalized.replace(/\./g, "").replace(/,/g, ".");
    }
    if (normalized === "") {
      return null;
    }
    var numberValue = Number(normalized);
    return Number.isNaN(numberValue) ? null : numberValue;
  }

  function parseDateBR(value) {
    if (!value) {
      return "";
    }
    var parts = String(value).split(" ");
    var datePart = parts[0];
    var datePieces = datePart.split("/");
    if (datePieces.length !== 3) {
      return value;
    }
    return datePieces[2] + "-" + datePieces[1] + "-" + datePieces[0];
  }

  function getColumnType(name) {
    if (name === "DTNEG") {
      return "year/quarter/month/day";
    }
    if (numericColumns.indexOf(name) >= 0) {
      return "number";
    }
    return "string";
  }

  function buildDataSource() {
    var rows = parseCSV(csvData).filter(function (row) {
      return row.length && row.join("").trim() !== "";
    });

    var headerIndex = rows.findIndex(function (row) {
      return row[0] === "VLRFRETE";
    });

    if (headerIndex === -1) {
      return [];
    }

    var headers = rows[headerIndex];
    var dataRows = rows.slice(headerIndex + 1);
    var schema = {};

    headers.forEach(function (name) {
      schema[name] = {
        type: getColumnType(name)
      };
    });

    var records = dataRows.map(function (row) {
      var record = {};
      headers.forEach(function (name, index) {
        var value = row[index] !== undefined ? row[index] : "";
        if (name === "DTNEG") {
          record[name] = parseDateBR(value);
        } else if (numericColumns.indexOf(name) >= 0) {
          record[name] = parseNumberBR(value);
        } else {
          record[name] = value;
        }
      });
      return record;
    }).filter(function (record) {
      return record.NUNOTA !== null && record.NUNOTA !== undefined && record.NUNOTA !== "";
    });

    return [schema].concat(records);
  }

  var report = {
    dataSource: {
      data: buildDataSource()
    },
    slice: {
      rows: [],
      columns: [],
      measures: []
    },
    formats: [{
      name: "formatting",
      thousandsSeparator: ".",
      decimalSeparator: ",",
      decimalPlaces: 2,
      currencySymbol: "",
      currencySymbolAlign: "left",
      nullValue: "",
      textAlign: "right",
      isPercent: false
    }],
    options: {
      showDefaultSlice: false,
      grid: {
        type: "flat"
      }
    }
  };

  window.PIVOT_CONFIG = {
    container: "wdr-component",
    width: "90%",
    height: 770,
    toolbar: true,
    report: Object.assign({}, baseReport, report)
  };
